@mike pinheiro 
Porém tais doenças antigas eram comuns numa época atrás, onde a expectativa de vida era baixa, no qual as crianças morriam com extrema facilidade. A morte, como hoje, era algo trivial, recorrente e passível de acontecer, as fronteiras do passado e o presente sempre são próximas, passível de algum conhecimento ser retirado. Talvez, num futuro distante, assim como tais doenças, ou talvez, como a Gripe Espanhola, os outros olhem com horror nossa realidade; e julguem, como acharem melhor, nossos métodos de enfrentamento diante de uma pandemia, como a ignoramos ou isolamos. Vimos países com baixíssimas mortes, como é o caso da Nova Zelândia, poderíamos ter evitado esse desastre, provavelmente, no início.
As análises com maiores números de pacientes, a inovação tecnológica de nosso tempo, temos de dar crédito a essas comunidades científica, pois nenhum resultado deve ser mostrado de maneira leviana, nenhuma indagação ou suspeita.

